По-хорошему надо подать в суд на эти сраные  шоу за вмешательство в частную жизнь. 1-2 канал не хочет осветить жизнь и деяния господина Потанина, который устроил экокатастрофу в России? Кишка тонка? Или осветили бы список Магнитского. 
Российские СМИ самые мерзкие СМИ в мире

